import React from 'react';
import Navbar from './Navbar';
import Head from 'next/head';

const layout = (props) => (
    <div>
        <Head>
            <title>BitzPrice</title>
        </Head>
        <Navbar />
        {props.children}
    </div>
);

export default layout;
